    return (
    <Container>
        <SubHeader current='Contact'/>
        <Row className="row-content align-itmes-center">
            <Col sm='4'></Col>
            <Col></Col>

        </Row>
        <Row className="row-content"></Row>
        ContactPage
    </Container>
    );
};

export default ContactPage;
